B.LT=A.a(s(["For k=0, i.e. without negative feedback, the characteristic curve is very steep (high amplification), but also highly non-linear, which indicates high distortion.","As k increases, the slope of the characteristic curve and thus the gain decreases. At the same time, however, the nonlinearity of the characteristic curve also decreases. Thus, negative feedback causes a decrease in gain, but also a decrease in distortion.","From the equation for A it follows that for sufficiently large values of a*k, the so-called loop gain, the total gain goes over into A=1/k. Thus, negative feedback causes the total gain A to no longer depend on the amplifier properties a, but only on the feedback network k.","If the loop gain a*k takes the value -1, the expression for A approaches infinity. In this case, the feedback amplifier oscillates. Since this is usually not desirable (exception: oscillator), the question arises as to how criteria for the stability of a feedback amplifier circuit can be specified."]),t.s)
