B.L6=A.a(s(["At the collector end (X=XB), the density n\xb4 is very low (~0) due to UBC<0, while at the emitter end (X=0) it reaches very high values due to UBE >0V. Due to the exponential dependence, even small voltage changes UBE are sufficient to achieve a change in the density of n` at the emitter end (X=0) of the base. The slope \u2013 and thus the current Ic through the transistor \u2013 thus depends directly on the base-emitter voltage UBE, whereby even very small changes in the base-emitter voltage cause a large change in Ic (amplifier effect)."]),t.s)
