B.Al=new A.bX('Das folgende Applet zeigt das B\xe4nderdiagramm (links) sowie das Energie-Impuls Diagramm (rechts) eines direkten bzw. eines indirekten Halbleiters. Der darzustellende Halbleitertyp kann mit Hilfe des Auswahlfeldes "Semiconductor type" ausgew\xe4hlt werden. Bet\xe4tigt man anschlie\xdfend die "Start Generation"-Schaltfl\xe4che, so wird das Auftreffen eines Photons auf den Halbleiter und die damit verbundene Generation eines Elektron-Loch-Paares animiert. Auf die gleiche Weise kann anschlie\xdfend die Animation der Thermalisierung und der Rekombination gestartet werden.\n\nMan sieht:\n',B.Jx,'The following applet shows the band diagram (left) and the energy-momentum diagram (right) of a direct and an indirect semiconductor, respectively. The type of semiconductor to be displayed can be selected using the "Semiconductor type" selection box. If you then click on the "Start Generation" button, the impact of a photon on the semiconductor and the associated generation of an electron-hole pair is animated. The animation of the thermalization and recombination can then be started in the same way.\n\nYou can see:\n',B.JJ,null)
B.V=new A.o3(0,"start")
