B.cp=new A.ai("\u2022 ",null,B.S,null,null,null,null,null,null)
B.aU=new A.a1z(0,"tight")
B.KT=A.a(s(["Beim direkten Halbleiter zeigt das Energie-Impuls Diagramm nach dem Generationsvorgang, dass sowohl die Energiebilanz auch die Impulsbilanz erf\xfcllt ist: Zum einen entspricht der energetische Abstand der Teilchen der Energie Wph des eingestrahlten Photons, zum anderen weisen Elektron und Loch identische Impulse i auf, da die Teilchen im Energie-Impuls Diagramm direkt \xfcbereinander liegen.","Nach der Generation k\xf6nnen sich die Ladungstr\xe4ger frei im Halbleiter bewegen, wobei sie ihre kinetische Energie durch St\xf6\xdfe an das Kristallgitter abgeben. Dies \xe4u\xdfert sich darin, dass sich Elektron und Loch jeweils in Richtung der Bandkanten, also zu niedrigeren Energiewerten hin bewegen (Thermalisierung).","Treffen nun ein Elektron und ein Loch aufeinander, so k\xf6nnen sie unter Aussendung eines Photons rekombinieren. Die Energie Wem eines unter diesen Bedingungen emittierten Photons entspricht etwa dem Wert des Bandabstandes Wg des Halbleiters."]),t.s)
B.Mf=A.a(s(["In the direct semiconductor, the energy-momentum diagram after the generation process shows that both the energy balance and the momentum balance are fulfilled: on the one hand, the energetic distance of the particles corresponds to the energy Wph of the incident photon, on the other hand, the electron and hole have identical momentums i, since the particles in the energy-momentum diagram are directly superimposed.","After generation, the charge carriers can move freely in the semiconductor, whereby they transfer their kinetic energy to the crystal lattice through collisions. This is expressed by the fact that the electron and hole each move in the direction of the band edges, i.e. towards lower energy values (thermalization).","If an electron and a hole meet, they can recombine by emitting a photon. The energy of a photon emitted under these conditions is approximately equal to the band gap Wg of the semiconductor."]),t.s)
B.Am=new A.bX("Direkter Halbleiter:",B.KT,"Direct semiconductor:",B.Mf,null)
