B.Rr=new A.f8(B.aD,B.k,B.i,B.V,null,B.av,null,B.KG,null)
B.It=A.a(s(["Wie beim direkten Halbleiter erfolgt unmittelbar nach der Generation die Thermalisierung, bei der die Ladungstr\xe4ger Energie und Impuls an das Kristallgitter abgeben.","Die Energieminima von Elektronen und L\xf6chern liegen jedoch bei indirekten Halbleitern bei unterschiedlichen Impulswerten. Eine direkte Rekombination der thermalisierten Ladungstr\xe4ger ist daher nicht ohne Weiteres m\xf6glich, da die Impulserhaltung in diesem Fall nicht erf\xfcllt w\xe4re. Da ein Photon praktisch keinen Impuls aufnehmen kann, bleibt nur die M\xf6glichkeit, die Impulsdifferenz an das Kristallgitter abzugeben. Dazu muss jedoch eine als Rekombinationszentrum wirkende St\xf6rstelle (z.B. ein Fremdatom) im Gitter vorhanden sein, mit der die Ladungstr\xe4ger wechselwirken k\xf6nnen."]),t.s)
B.KN=A.a(s(["As with direct semiconductors, thermalization occurs immediately after generation, during which the charge carriers release energy and momentum to the crystal lattice.","However, the energy minima of electrons and holes in indirect semiconductors are at different momentum values. Direct recombination of the thermalized charge carriers is therefore not possible without further ado, since momentum conservation would not be fulfilled in this case. Since a photon can absorb practically no momentum, the only possibility is to transfer the momentum difference to the crystal lattice. However, for this to happen, there must be an impurity (e.g. an impurity atom) in the lattice that acts as a recombination center and with which the charge carriers can interact."]),t.s)
