B.Jw=A.a(s(["Der Verst\xe4rkertransistor T3 hat das grau gezeichnete Ausgangskennlinienfeld. Die von der angelegten Spannung Ue abh\xe4ngige, aktuelle Kennlinie ist rot dargestellt.","Tr\xe4gt man zus\xe4tzlich die Kennlinie des Stromspiegels T1 und T2 in das gleiche Diagramm ein (blaue Kurve), ergibt der Schnittpunkt beider Kennlinien f\xfcr jede Spannung Ue die sich einstellende Ausgangsspannung Ua sowie den Strom IC durch die Transistoren T2 und T3.","Um bei der Verst\xe4rkung sinusf\xf6rmiger Signale (AC on) eine gr\xf6\xdftm\xf6gliche Aussteuerung zu erm\xf6glichen, w\xe4hlt man die Spannung Ue,A so, dass der Arbeitspunkt etwa in der Mitte des aussteuerbaren Bereiches liegt.","Wegen des flachen Verlaufs der Kennlinien haben bereits kleine \xc4nderungen der Eingangsspannung Ue gro\xdfe Auswirkungen auf die Lage des Schnittpunktes der beiden Kurven und damit auf die Spannung Ua am Ausgang der Schaltung. Die Verst\xe4rkung dieser Schaltung ist daher sehr gro\xdf.","Da die Verst\xe4rkung um so gr\xf6\xdfer ist, je flacher die Steigung der Kennlinien ist, steigt die Verst\xe4rkung mit zunehmendem Ausgangswiderstand r0, d.h. mit zunehmender Early-Spannung Uan der Transistoren."]),t.s)
B.Kf=A.a(s(["The amplifier transistor T3 has the gray-shaded output characteristic field. The current characteristic, which depends on the applied voltage Ue, is shown in red.","If the characteristic curve of the current mirror T1 and T2 is also entered into the same diagram (blue curve), the intersection of the two characteristic curves for each voltage Ue gives the output voltage Ua and the current IC through the transistors T2 and T3.","To maximize the amplification of sinusoidal signals (AC on), the voltage Ue,A is chosen so that the operating point is approximately in the middle of the controllable range.","Due to the flatness of the characteristic curves, even small changes in the input voltage Ue have a large effect on the position of the intersection of the two curves and thus on the voltage Ua at the output of the circuit. The gain of this circuit is therefore very large.","Since the amplification is greater the flatter the characteristic curve, the amplification increases with increasing output resistance r0, i.e. with increasing early voltage Uan of the transistors."]),t.s)
